body{
  padding: 0;
  margin: 0;
}

h2,h5,h6{
  margin: 0;
}

.pt-4{
  padding-top: 2rem;
}

.pt-5{
  padding-top: 3rem;
}

.pt-6{
  padding-top: 4rem;
}

.main-title{
  font-size: 18px;
  line-height: 1.56;
  text-align: center;
  font-weight: normal;
  position: relative;
  &.gray{
    color: #333333;
  }
  &.white{
    color: #ffffff;
  }
}

.main-subtitle{
  font-size: 20px;
  font-weight: normal;
  line-height: 1.75;
  text-align: center;
  color: #a8a1ec;
  margin-top: 45px;
  margin-bottom: 48px;
  position: relative;
  .dot{
    color: #fff;
    &:nth-child(2){
      &::after{
        content: '';
        position: absolute;
        left: 50%;
        transform: translateX(-50%);
        margin-left: 37px;
        border-radius: 3px;
        top: -3px;
        width: 3px;
        height: 3px;
        background-color: #fff;
      }
    }
    &::after{
      content: '';
      position: absolute;
      left: 50%;
      transform: translateX(-50%);
      margin-left: 20px;
      border-radius: 3px;
      top: -3px;
      width: 3px;
      height: 3px;
      background-color: #fff;
    }
  }
}

.pen-wrap{
  width: 100%;
  height: auto;
  position: relative;
  .pen-section1{
    width: 100%;
    margin: 0 auto;
    height: 1002px;
    position: relative;
    background-color: #271d49;

    .pen-section1-copy{
      position: relative;
      margin: 0 auto;
      background: url("https://image.okaydoctor.co.kr/image/img-mb-sb@2x.png");
      background-size: 100% 100%;
      width: 320px;
      height: 390px;
      margin-bottom: 60px; 
    }
    .pen-section1-bottom-img{
      height: 325px;
      width: 100;
      position: relative;
      border: 1px solid #acacac;
      &::after{
        content: 'img';
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50% -50%);
        font-size: 20px;
        color: #acacac;
      }
    }
  }

  .pen-section2{
    width: 100%;
    margin: 0 auto;
    height: 1114px;
    position: relative;
    background-color: #493fa2;
    overflow: hidden;
    .pen-section2-bg{
      position: absolute;
      top: -20px;
      left: 50%;
      transform: translateX(-50%);
      margin-left: 0px;
      background: url("https://image.okaydoctor.co.kr/image/img-mb-deco@2x.png") no-repeat;
      background-size: 100% 100%;
      width: 650px;
      height: 950px;
    }

    .pen-section2-card{
      width: 308px;
      height: 486px;
      border-radius: 16px;
      box-shadow: 2px 2px 22px 0 #322b6f;
      background-color: #ffffff;
      margin: 56px auto 40px auto;
      position: relative;
      &.he-450{
        height: 459px;
        margin: 40px auto 0 auto;
      }

      .pen-section2-slide{
        width: 259px;
        height: 197px;
        margin: 0 auto;
        border: 1px solid #acacac;
      }

      .pen-card-title{
        padding-top: 33px;
        padding-bottom: 20px;
        font-size: 18px;
        font-weight: normal;
        line-height: 1.56;
        text-align: center;
        color: #333333;
      }
      .pen-card-text{
        font-size: 13px;
        font-weight: normal;
        line-height: 1.54;
        text-align: center;
        color: #555555;
        padding-top: 30px;
      }

      .easypen-detail{
        margin: 0 auto;
        text-align: center;
        width: 124px;
        height: 31px;
        margin-top: 58px;
        a{
          padding: 9px 11px;
          line-height: 31px;
          border: 1px solid #6439fd;
          border-radius: 17px;
          color: #6439fd;
          font-size: 12px;
          text-decoration: none;
        }
      }
    }

  }
  .pen-go-lecture{
    position: absolute;
    bottom: 30px;
    right: 50%;
    transform: translateX(-50%);
    margin-right: -280px;
    margin-top: 24px;
    h6{
      width: 241px;
      height: 19px;
      font-size: 15px;
      font-weight: normal;
      color: #fff;
    }
    .lecture{
      color: #50e3c2;
      font-weight: bold;
      text-decoration: underline;
    }
  }
}

.detail-wrap{
  width: 100%;
  height: 100vh;
  background-color: #493fa2;
  position: relative;
  .detail-wrap-box{
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 308px;
    height: 440px;
    border-radius: 14px;
    background-color: #ffffff;
    .detail-title{
      position: absolute;
      top: 20px;
      left: 24px;
      h2{
        font-size: 15px;
        font-weight: normal;
        color: #333333;
      }
    }

    .datail-contents{
      padding: 16px 0 24px 24px;
      margin-top: 29px;
      .detail-subtitle{
        margin: 0 auto;
        text-align: left;
        h3{
          font-size: 13px;
          color: #333333;
          font-weight: normal;
        }
      }

      .detail-text{
        margin: 0 auto;
        .detail-text-list{
          list-style: none;
          font-size: 10px;
          color: #666666;
          margin: 0;
          padding: 0;
          .list{
            width: 100%;
            padding-bottom: 8px;
            &.pb-21{
              padding-bottom: 21px;
            }
            .title{
              width: 60px;
              display: inline-block;
              padding-right: 31px;
            }
          }
        }
      }
    }
  }

  .close{
    position: absolute;
    background: url("https://image.okaydoctor.co.kr/image/ic-m-close@2x.png") no-repeat;
    top: 20px;
    right: 20px;
    width: 18px;
    height: 18px;
    background-size: 100% 100%;
  }
}
